import styled from "styled-components";

export const ListaUsuariosContainer = styled.div`
	flex: 4;
`;

export const BotaoEditar = styled.button`
	border: none;
	border-radius: 10px;
	padding: 5px 10px;
	background-color: #3bb077;
	color: white;
	cursor: pointer;
	margin-right: 200px;
`;
